}

  render() {
    return (
      // <Container className="home">
        <Row>
          <Col>
            <h1 className="home-text-large">
            Rethink<br />innovate.
            </h1>
            <p className="home-text-small">Caleb, software developer in Columbus, Ohio</p>
          </Col>
          <Col>
            <span className="resume-link" onClick={this.toGoogle}>Download my resume.</span>
          </Col>
        </Row>
      // </Container>
    );
  }
}
